create table EXT_CORE.CF_MUNICIPALITY
(
    id                 int         not null
        constraint CF_MUNICIPALITY_pk
            primary key,
    districtid         int         NOT NULL,
    code               varchar(10) not null,
    code2              varchar(10),
    mainsettlementcode varchar(10),
    category           varchar(50),
    name               varchar(255),
    alias              varchar(200),

    description        varchar(500),
    isactive           bit,
    version            int         NOT NULL DEFAULT 0,
    nameen             varchar(200),
);



